    <OrderItem
    key={index} 
    item={item}
    onSubtract={onSubtract} 
    onAddClick={onAddClick}
    />)

    return (
        <div>
            Order Show
            {orderCheckout}
            <h4>Total: $ </h4>
        </div>
    )
}

export default OrderShow;
